opolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",vfc='Dienstag',iBc='Dimension',ymc='Dimension [height=',xxc='DirectionalTextHelper',Lfc='Do',Efc='Do.',Axc='DockLayoutPanel',Bxc='DockLayoutPanel$Direction',Cxc='DockLayoutPanel$Direction;',Fxc='DockLayoutPanel$DockAnimateCommand',Dxc='DockLayoutPanel$LayoutData',Ftc='DomEvent',Ktc='DomEvent$Type',xfc='Donnerstag',Szc='Double',xjc='EAST',Gcc='EEE, d MMM yyyy HH:mm:ss Z',qpc='EEE. dd MMM. yyyy HH:mm:ss',$cc='EEEE d. MMMM',Jcc='EEEE, d. MMMM y',cbc='EM',zhc='EMPTY',Ehc='ENABLED',Yfc='END',ebc='EX',awc='ElementMapperImpl',bwc='ElementMapperImpl$FreeNode',Yec='English',Rsc='Enum',Pec='Etc/GMT',Rec='Etc/GMT+',Qec='Etc/GMT-',xbc='Event type',Yyc='Event$NativePreviewEvent',Xtc='EventBus',csc='EventObject',hsc='Exception',aic='Expecting version 6 from server, got ',scc='F',znc='F8834F07517EF3B7D02B9E845E5E1B88',Zac='FIXED',yic='FLOAT',enc='Fail: ',iec='Feb',nfc='Feb.',cfc='Februar',Ydc='February',Xqc='Female',Tzc='Float',Gxc='FlowPanel',Vwc='FocusImpl',Xwc='FocusImplSafari',Wwc='FocusImplStandard',exc='FocusWidget',Alc='For input string: "',Mfc='Fr',Ffc='Fr.',yfc='Freitag',Kec='Fri',Bec='Friday',Lbc='GET',Hpc='GGD55XLBAH',trc='GGD55XLBAJ',Gqc='GGD55XLBBI',Gpc='GGD55XLBCH',Iqc='GGD55XLBCI',ahc='GGD55XLBDB',Fpc='GGD55XLBDH',Crc='GGD55XLBDJ',pqc='GGD55XLBDK',Pgc='GGD55XLBEB',Dpc='GGD55XLBEH',Hqc='GGD55XLBEI',urc='GGD55XLBEJ',bhc='GGD55XLBFB',Kpc='GGD55XLBFH',drc='GGD55XLBFI',Vrc='GGD55XLBFK',arc='GGD55XLBGI',Trc='GGD55XLBGK',ehc='GGD55XLBHB',Spc='GGD55XLBHH',Qqc='GGD55XLBHI',Src='GGD55XLBHK',Upc='GGD55XLBIH',Prc='GGD55XLBIK',Tpc='GGD55XLBJH',P
